import styled from "styled-components";

const Botao = styled.button`
background-color: var(--azul-escuro);
border-radius: 8px;
padding: 12px 16px;
color: var(--branco);
border: none;
margin-top: 1em;
font-weight: 700;
line-height: 19px;
cursor: pointer;
`

export default Botao;
